import React from "react";
import "../style/ContactPage.css";


const ContactPage = () => {
  return (
    <div>
      <h1>Contact</h1>
        <div className="row">
            <div className="col-md-9">
                  <div className="Card-container">
                      <div className="info">
                          <h2>CE-KMITL-59</h2>
                          <div style={{ backgroundColor: "#c8c8c8", width: "25vw", height: "1px", margin: "1rem 0" }}></div>
                          <p>Email : manassawin369@gmail.com</p>
                          <p>Tel : 096-634-7570</p>
                    </div>
            </div>
                <div className="pic">
                          <img src="https://images.unsplash.com/photo-1541647376583-8934aaf3448a?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=634&q=80" alt="profile-pic"
                              style={{
                                  borderRadius: "50%",
                                  width: "80px",
                                  height: "80px",
                                  backgroundColor: "#eaeaea",
                                  objectFit: "cover"
                              }}
                />   
                </div>
            </div>
      
        
        </div>
    </div>
  );
};

export default ContactPage;
